export default function Cv(props){
    return(
        <>
         <div className="cv-wraper">
             <div className="cv-block">
                <div className="cv-wrap">
                     <h1 className="cv-name">{props.value.firstName} {props.value.lastName}</h1>
                     <h5 className="cv-email">{props.value.email}</h5>
                     <h5 className="cv-number">{props.value.number}</h5>
                     {props.value.textarea?<h2 className="cv-about">ჩემს შესახებ</h2>:null}
                     <p className="cv-textarea">{props.value.textarea}</p>
                </div>
                { props.imgURL.map(imageSrc => <img className="cv-photo" src={imageSrc} />)}
             </div>
             {props.value.textarea?<div className="cv-line"></div>:null}
             <img className="staricon" src={props.staricon} alt='star-icon'/>
          </div>
        </>
    )
}
